import React from "react";

class ProductList extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return ( <
            React.Fragment >
            <
            h1 className = "head " > Product - List < /h1>  <
            section className = "p-3" >
            <
            div class = "container" >
            <
            div class = "row" >
            <
            div class = "col-md-4" >
            <
            p class = "h3" > Cart Items <
            /p> < /
            div > <
            /div> < /
            div >
            <
            /section> < /
            React.Fragment >
        );
    }
}

export default ProductList;
